import  React  from "react";
import { NavLink, Route } from 'react-router-dom';
import  Navbar  from "react-bootstrap/Navbar";
import  Nav  from "react-bootstrap/Nav";
import  NavDropdown   from "react-bootstrap/NavDropdown";
import FormControl  from "react-bootstrap/FormControl";
import { Container , Row , Col , Card, Button, Form  } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
export function MainHolder(){
    return <div className="content">
        <AppBar/>
        <Main />

</div>
}
export function SideBar(){
    return <div className="sidebar">
        <div className="logo">
            <Link to="/"><img src={logo} /></Link>
        </div>
        <ul className="nav-list">
            {menus.map((v,i) => <li key={i}>
                <NavLink exact={v.path=='/'} activeClassName='active' to={v.path}>
                    <img src={v.icon} />
                    {v.name}
                </NavLink>
            </li> )}
        </ul>
    </div>
}
function AppBar(){
    return (<div className="appbar">
        <div className="appbar-left">
        <header theme='light' className='header'>
        <Navbar  expand="lg">
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav" >
                <Nav className="mr-auto ml-auto pt-2 pb-2" defaultActiveKey='/'>
                <Nav.Link  href="/">About us</Nav.Link>
                <Nav.Link eventKey="link-1" href="#/Readers">Readers</Nav.Link>
                <Nav.Link eventKey="link-2" href="#/link">Helo Memo</Nav.Link>
                <Nav.Link eventKey="link-3" href="#link">Contact</Nav.Link>
                <div className='right--button'>
                    <LoginComponent/>
                    <RegisterComponent/>
                </div>
                </Nav>
            </Navbar.Collapse>
            </Navbar>
        </header>
        </div>

    </div>)
}


function Main(){
    const routes = [
        {path: '/', exact:true, component: HomePage  },
    ];
    return (<div className="main">
        {routes.map(function (v, i) {
                return <Route {...v} />;
            } )}
    </div>)
}
